import React, { Component } from 'react';
import { Table, Switch } from 'antd';

import IMG01 from '../../../assets/images/doctor-thumb-01.jpg';
import IMG02 from '../../../assets/images/doctor-thumb-02.jpg';
import IMG03 from '../../../assets/images/doctor-thumb-03.jpg';
import IMG04 from '../../../assets/images/doctor-thumb-04.jpg';
import IMG05 from '../../../assets/images/doctor-thumb-01.jpg';
import IMG06 from '../../../assets/images/doctor-thumb-02.jpg';
import IMG07 from '../../../assets/images/doctor-thumb-03.jpg';
import IMG08 from '../../../assets/images/doctor-thumb-04.jpg';

class TableProposals extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        { id: 1, image: IMG01, Name: "Dr. Ruby Perrin", Speciality: "Dental", PatientImg: IMG05, PatientName: 'Charlene Reed', AppointmentDate: '9 Nov 2019', AppointmentTime: '11.00 AM - 11.15 AM', status: true, Amount: "$3200.00" },
        { id: 2, image: IMG02, Name: "Dr. Darren Elde", Speciality: "Dental", PatientImg: IMG06, PatientName: 'Travis Trimble', AppointmentDate: '5 Nov 2019', AppointmentTime: '11.00 AM - 11.15 AM', status: false, Amount: "$3100.00" },
        { id: 3, image: IMG03, Name: "Dr. Deborah Angel", Speciality: "Cardiology", PatientImg: IMG07, PatientName: 'Carl Kelly', AppointmentDate: '10 Dec 2019', AppointmentTime: '11.00 AM - 11.15 AM', status: true, Amount: "$4000.00" },
        { id: 4, image: IMG04, Name: "Dr. Sofia Brient", Speciality: "Urology", PatientImg: IMG08, PatientName: 'Charlene Reed', AppointmentDate: '20 Dec 2019', AppointmentTime: '11.00 AM - 11.15 AM', status: false, Amount: "$3500.00" },

      ]
    }
  }

  onChangeHandle = () => {

  }
  render() {
    const { data } = this.props
    console.log(data);

    const columns = [
      {
        title: 'Employee',
        dataIndex: 'employee',
        render: ({ name, photo }) => (
          <h2 className="table-avatar">
            <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${photo}`} /></a>
            <a href="/admin/profile">{name}</a>
          </h2>
        ),
      },
      {
        title: 'Job',
        dataIndex: 'job',
        // render: ({ category_id }) => (
        //   <h2 className="table-avatar">
        //     <span>{category_id}</span>
        //     {/* <a href="/admin/profile" className="avatar avatar-sm mr-2"><img alt="" src={`http://excodeteam.com/crs/public/images/${image}`} /></a>
        //     <a href="/admin/profile">{employer_id}</a> */}
        //   </h2>
        // ),
      },
      {
        title: 'status',
        dataIndex: 'status',
      },
    ]
    return (
      <div>
        <Table className="table-striped"
          style={{ overflowX: 'auto' }}
          columns={columns}
          // bordered
          dataSource={data}
          rowKey={record => record.id}
          pagination={false}
        />
      </div>

    )
  }
};

export default TableProposals;
